import React from "react";
import { Route, IndexRoute } from "react-router-dom";
import App from ".app";
import Home from "./views/home";

export default (
  <Route path="/" component={App}>
    <IndexRoute component={Home} />
    <Route path="*" component={Home} />
  </Route>
);
